#include<iostream>
#include<string>
using namespace std;

 int maxVowels(string s, int k) {
        char vowels[]={'a','e','i','o','u'};
        int vowelcount=0;
        
        int index=0;
        while(index<=s.length()-k){
           string s1=s.substr(index,k);
             int count=0;
             for(int i=0;i<k;i++){
                for(int j=0;j<5;j++){
                    if(s1[i]==vowels[j]){
                        count++;
                    }
                }
                
             }

             if(count==k){
                 vowelcount=k;
                 return k;
             }
             else if(count>=vowelcount){
                vowelcount=count;
             }
             index++;
        }
       return vowelcount;
    }
    int main(){
        string s="";
    cout<<maxVowels(s,50436);
    }

   